import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  container:{
    width:790,
    margin:"0 auto"
  },
  getStarted:{
    width:480,
    margin:"0 auto"
  },
  text:{
    letterSpacing:2.25,
    textAling:'center',

  }
})
